export async function getTweets(): Promise<ITweet[]> {
  const ids = TWEET_IDS
  try {
    const tweets = await Promise.all(
      ids.map(async (id) => {
        const res = await fetch("https://chirp.alexandru.so/api/tweet/" + id, {
          next: { revalidate: 31536000 },
        })
        const data = await res.json()
        return data
      })
    )

    return tweets
  } catch (error) {
    console.error(error)
    return []
  }
}

